__NUXT_JSONP__("/gallery/new-arrival-", (function(a,b){return {data:[{document:{date:a,title:[{type:"heading3",text:"New Arrival !",spans:[]}],photo:{dimensions:{width:800,height:1067},alt:a,copyright:a,url:"https:\u002F\u002Fimages.prismic.io\u002Ffunk\u002Feb480e87-275c-4a68-9ee8-157adbd56939_Mel+Matteo.jpg?auto=compress,format",small:{dimensions:{width:320,height:427},alt:a,copyright:a,url:"https:\u002F\u002Fimages.prismic.io\u002Ffunk\u002Feb480e87-275c-4a68-9ee8-157adbd56939_Mel+Matteo.jpg?auto=compress,format&rect=0,0,800,1067&w=320&h=427"}},content:[{type:b,text:"Introducing our Grandson Matteo. Just after his birth, between  myself, my wife and his dad we got some cool shots of the little guy on  the fly between feeds and nappy changes.",spans:[]},{type:b,text:"But on the fly was never  gonna be good enough, so we went shopping and bought Matteo a rockin’  new outfit, got back home and fed him and burped him and changed his  nappy (again!), got him smellin’ sweet and lookin’ cute and dressed him  up for his first proper photo shoot !",spans:[]},{type:b,text:"We found a place where the  sun came in dispersed through venetian blinds and all that was left to  do was put his mommy in the mix and let the magic happen. And of course I  took a truckload of shots with and without fill-in flash. But this  particular one did it for me. Only post pro was a bit of soft focus and  vignetting round the edges to highlight the faces.",spans:[]},{type:b,text:"I love it when beauty happens in the Gallucci family. And it just doesn’t get more beautiful than this.\nAt least till the next one comes along…:-)",spans:[]},{type:b,text:"Canon EOS 5D MkI, EF 100 mm f2,8 fixed focal.",spans:[]}],page:"Page 2",tag:"portrait"}}],fetch:[],mutations:void 0}}(null,"paragraph")));